import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';
import {
    Button,
    Card,
    Container,
    Row,
    Col
} from 'react-bootstrap';
import './Footer.css';

function Footer()
{
    return (
        <Row className="Footer">
            <div className="Main-footer">
                <Col>

                </Col>
            </div>
        </Row>
    );
}

export default Footer;
